  input: '"TEXT","F3XA","C00301366","This amendment is in response to your letter
    stating a concern with the Amended October Monthly Report (9/1/02-9/30/02, dated
    10/22/02, filed by the Majority Leaders Fund.  In your letter dated December 11,
    2002, your report indicates the totals listed on Lines 23 and 29 on Column B of
    the Detailed Summary Pages are incorrect.  Please find an amended Detailed Summary
    Page reflecting that change.  You also indicated that the campaign must attempt
    to obtain the occupations and name of employer for all individuals who contribute
    more than $200 in a calendar year.   Our procedure regarding this matter is sending
    a letter to the contributor clearly requesting the following information.  If
    the information is not provided we then again send out another written request
    clearly requesting the information.  If you need a copy of this letter we will
    be glad to forward it to you.  Please also find an amended Schedule B supporting
    contributions to federal candidates and committees supporting Line 23 of the Detailed
    Summary Page.  The committee has taken the necessary steps so this will not happen
    in the future.  If you have any further questions please let us know."'
